import React from "react";
import ReactDOM from 'react-dom'
import { useStoreContext } from "../../utils/GlobalState";
import "./style.css";
import Tester from '../Product/product1.jpg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'

const element = <FontAwesomeIcon icon={faCoffee} />

ReactDOM.render(element, document.body)

function CheckoutItem() {
  const [store] = useStoreContext();

  return (<div id="checkoutItem">
            <img src={Tester} alt="product preview" id="productPreview"></img>
            <p>Stapler</p>
            <p>$6.75 <FontAwesomeIcon icon={[faCoffee]} /></p>
            <p>Qty: <input type="number" id="checkoutQty" placeholder="8"></input></p>
      </div>
)}

export default CheckoutItem;
